var title_f34_55_35706="ECG WPW tutorial";
var content_f34_55_35706=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75578&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75578&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1142px;\">",
"  <div class=\"figure\" style=\"width: 556px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) showing the Wolff-Parkinson-White pattern",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 536px; height: 222px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The two main electrocardiographic features of Wolff-Parkinson-White (WPW) pattern include a short PR interval (&lt;0.12 seconds) and a delta wave (red arrows). The QRS complex is wide (&gt;0.12 seconds) and represents a fusion beat; the initial portion (delta wave) results from rapid ventricular activation via the accessory pathway (pre-excitation), while the termination of ventricular activation is via the normal conduction system leading to a fairly normal terminal portion of the QRS.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 466px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal sinus rhythm at a rate of 71 beats/min, a P wave axis of 45&deg;, and a PR interval of 0.15 sec.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
