var title_f34_55_35707="Prone improvement mechanisms";
var content_f34_55_35707=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F54334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F54334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed mechanisms for prone response",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physiologic effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical result",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Improved configuration between lung and thorax",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Heart is dependent",
"       </td>",
"       <td>",
"        More homogeneous Ppl gradient in ventrodorsal and cephalocaudal planes",
"       </td>",
"       <td>",
"        Improved ventilation distribution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Smaller volume of dependent lung",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Increased FRC (&darr; shunt)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Abdomen is unsupported*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Secretion mobilization",
"       </td>",
"       <td>",
"        Improved bronchial drainage",
"       </td>",
"       <td>",
"        Improved ventilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Improved aerosol delivery",
"       </td>",
"       <td>",
"        Improved effect of aerosolized meds",
"       </td>",
"       <td>",
"        Improved ventilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        More homogeneous perfusion",
"       </td>",
"       <td>",
"        Less dependent perfusion",
"       </td>",
"       <td>",
"        Improved V/Q matching (&darr; shunt)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Ppl: Pleural pressure; FRC: functional residual capacity; V/Q: ventilation-perfusion.",
"     <br>",
"      * Assumes prone positioning with the upper chest and pelvis supported and the abdomen suspended.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f34_55_35707=[""].join("\n");
