var title_f34_55_35708="Parenteral iron dose";
var content_f34_55_35708=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F54677&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F54677&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Calculation of parenteral iron dose for treatment of adults with iron deficiency anemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Required information",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Body weight (kilograms) = BW",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        If patient is obese, use lean or ideal body weight*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin concentration (g/dL) = Hgb",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Concentration of elemental iron in the parenteral product (mg/mL) = C",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Assumptions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood volume is 65 mL per kilogram",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin concentration to be corrected to 14.0 g/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Each gram of hemoglobin contains 3.3 mg of iron",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No additional iron to be given for repletion of body stores",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Intermediate calculations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood volume (dL) = 65 (mL/kg) x body weight (kg) &divide; 100 (mL/dL)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin deficit (g/dL) = 14.0 - patient hemoglobin concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin deficit (g) = hemoglobin deficit (g/dL) x blood volume (dL)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Iron deficit (mg) = hemoglobin deficit (g) x 3.3 (mg Fe/g Hgb)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Volume of parenteral iron product required (mL) = iron deficit (mg) &divide; C (mg/mL)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Final calculations",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin iron deficit (mg) = BW x (14 - Hgb) x (2.145)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Volume of product required (mL) = BW x (14 - Hgb) x (2.145) &divide; C",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Example",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        60 kg woman with a hemoglobin concentration of 8 g/dL. Parenteral iron product is iron sucrose (C = 20 mg elemental iron/mL).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin iron deficit = 60 x (14 - 8) x (2.145) = 772 mg iron",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Volume of iron sucrose needed = 60 x (14 - 8) x (2.145) &divide; 20 = 38.6 mL",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Calculators are available in UpToDate to determine ideal body weight and lean body weight.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     The concentration of elemental iron in the various products is, as follows: iron dextran: 50 mg/mL; iron sucrose: 20 mg/mL; ferric gluconate: 12.5 mg/mL; ferumoxytol: 30 mg/mL; ferric carboxymaltose: 50 mg/mL.",
"     <br/>",
"     &Delta; These calculations are based upon the assumptions listed above. If correction is desired for a different blood volume, final hemoglobin concentration, or for additional iron for body stores, the intermediate calculations can be employed.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     The product information sheet should be consulted in order to determine the need for a test dose, proper dilution of the product and rate of infusion, as well as the maximal suggested dose per infusion session.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
